import * as React from 'react';
import { Component } from 'react-simplified';
import ReactDOM from 'react-dom';
import { NavLink, HashRouter, Route } from 'react-router-dom';
import { studentService, courseService } from './services';

import createHashHistory from 'history/createHashHistory';
const history = createHashHistory(); // Use history.push(...) to programmatically change path, for instance after successfully saving a student




class Menu extends Component {
  render() {
    return (
      <table>
        <tbody>
          <tr>
            <td>
              <NavLink exact activeStyle={{ color: 'darkblue' }} to="/">
                WhiteBoard
              </NavLink>
            </td>
            <td>
              <NavLink activeStyle={{ color: 'darkblue' }} to="/students">
                Students
              </NavLink>
            </td>
            <td>
              <NavLink activeStyle={{ color: 'darkblue' }} to="/courses">
                Courses
              </NavLink>
            </td>
          </tr>
        </tbody>
      </table>
    );
  }
}

class Home extends Component {
  render() {
    return <div>Welcome to WhiteBoard</div>;
  }
}

class StudentList extends Component {
  students = [];

  render() {
    return (
      <div>
        <ul>
          {this.students.map(student => (
            <li key={student.id}>
              <NavLink activeStyle={{ color: 'darkblue' }} to={'/students/' + student.id}>
                {student.name}
              </NavLink>
            </li>
          ))}
        </ul>
        <button type="button" onClick={this.new}>
          New
        </button>
      </div>
    );
  }

  mounted() {
    studentService.getStudents(students => {
      this.students = students;
    });
  }

  new() {
    history.push('/new_student');
  }
}

class StudentDetails extends Component {
  student = null;
  courses = [];

  render() {
    if (!this.student) return null;

    return (
      <div>
        <ul>
          <li>Name: {this.student.name}</li>
          <li>Email: {this.student.email}</li>
          <li>
            Courses:
            <ul>
              {this.courses.map(course => (
                <li key={course.id}>{course.name}</li>
              ))}
            </ul>
          </li>
        </ul>
        <button type="button" onClick={this.edit}>
          Edit
        </button>
        <button type="button" onClick={this.delete}>
          Delete
        </button>
      </div>
    );
  }

  mounted() {
    studentService.getStudent(this.props.match.params.id, student => {
      this.student = student;
    });

    studentService.getCourses(this.props.match.params.id, courses => {
      this.courses = courses;
    });
  }

  edit() {
    history.push('/students/' + this.student.id + '/edit');
  }

  delete() {
    studentService.deleteStudent(this.props.match.params.id, () => history.push('/students'));
  }
}

class StudentNew extends Component {
  name = '';
  email = '';

  render() {
    return (
      <div>
        <ul>
          <li>
            Name: <input type="text" value={this.name} onChange={e => (this.name = e.target.value)} />
          </li>
          <li>
            Email:
            <input type="text" value={this.email} onChange={e => (this.email = e.target.value)} />
          </li>
        </ul>
        <button type="Add" onClick={this.add}>
          Add
        </button>
      </div>
    );
  }

  add() {
    studentService.addStudent(this.name, this.email, id => {
      history.push('/students/' + id);
    });
  }
}

class StudentEdit extends Component {
  student = null;
  courses = [];
  allCourses = [];

  render() {
    if (!this.student) return null;

    return (
      <div>
        <ul>
          <li>
            Name: <input type="text" value={this.student.name} onChange={e => (this.student.name = e.target.value)} />
          </li>
          <li>
            Email:
            <input type="text" value={this.student.email} onChange={e => (this.student.email = e.target.value)} />
          </li>
          <li>
            Courses:
            <ul>
              {this.courses.map(course => (
                <li key={course.id}>
                  {course.name}{' '}
                  <button type="button" onClick={() => this.removeCourse(course.id)}>
                    -
                  </button>
                </li>
              ))}
            </ul>
            Add course:
            <ul>
              {this.allCourses
                .filter(allCourse => this.courses.every(course => allCourse.id != course.id))
                .map(course => (
                  <li key={course.id}>
                    {course.name}{' '}
                    <button type="button" onClick={() => this.addCourse(course.id)}>
                      +
                    </button>
                  </li>
                ))}
            </ul>
          </li>
        </ul>
        <button type="save" onClick={this.save}>
          Save
        </button>
      </div>
    );
  }

  mounted() {
    studentService.getStudent(this.props.match.params.id, student => {
      this.student = student;
    });

    studentService.getCourses(this.props.match.params.id, courses => {
      this.courses = courses;
    });

    courseService.getCourses(courses => {
      this.allCourses = courses;
    });
  }

  removeCourse(id) {
    studentService.removeCourse(this.props.match.params.id, id, () => {
      studentService.getCourses(this.props.match.params.id, courses => {
        this.courses = courses;
      });
    });
  }

  addCourse(id) {
    studentService.addCourse(this.props.match.params.id, id, () => {
      studentService.getCourses(this.props.match.params.id, courses => {
        this.courses = courses;
      });
    });
  }

  save() {
    studentService.updateStudent(this.student, () => {
      history.push('/students/' + this.props.match.params.id);
    });
  }
}

class CourseList extends Component {
  courses = [];

  render() {
    return (
      <div>
        <ul>
          {this.courses.map(course => (
            <li key={course.id}>
              <NavLink activeStyle={{ color: 'darkblue' }} to={'/courses/' + course.id}>
                {course.name}
              </NavLink>
            </li>
          ))}
        </ul>
        <button type="button" onClick={this.new}>
          New
        </button>
      </div>
    );
  }

  mounted() {
    courseService.getCourses(courses => {
      this.courses = courses;
    });
  }

  new() {
    history.push('/new_course');
  }
}

class CourseDetails extends Component {
  course = null;
  students = [];

  render() {
    if (!this.course) return null;

    return (
      <div>
        <ul>
          <li>Code: {this.course.code}</li>
          <li>Name: {this.course.name}</li>
          <li>
            Students:
            <ul>
              {this.students.map(student => (
                <li key={student.id}>{student.name}</li>
              ))}
            </ul>
          </li>
        </ul>
        <button type="button" onClick={this.edit}>
          Edit
        </button>
        <button type="button" onClick={this.delete}>
          Delete
        </button>
      </div>
    );
  }

  mounted() {
    courseService.getCourse(this.props.match.params.id, course => {
      this.course = course;
    });

    courseService.getStudents(this.props.match.params.id, students => {
      this.students = students;
    });
  }

  edit() {
    history.push('/courses/' + this.course.id + '/edit');
  }

  delete() {
    courseService.deleteCourse(this.props.match.params.id, () => history.push('/courses'));
  }
}

class CourseNew extends Component {
  code = '';
  name = '';

  render() {
    return (
      <div>
        <ul>
          <li>
            Code: <input type="text" value={this.code} onChange={e => (this.code = e.target.value)} />
          </li>
          <li>
            Name:
            <input type="text" value={this.name} onChange={e => (this.name = e.target.value)} />
          </li>
        </ul>
        <button type="Add" onClick={this.add}>
          Add
        </button>
      </div>
    );
  }

  add() {
    courseService.addCourse(this.code, this.name, id => {
      history.push('/courses/' + id);
    });
  }
}

class CourseEdit extends Component {
  course = null;
  students = [];
  allStudents = [];

  render() {
    if (!this.course) return null;

    return (
      <div>
        <ul>
          <li>
            Code: <input type="text" value={this.course.code} onChange={e => (this.course.code = e.target.value)} />
          </li>
          <li>
            Name:
            <input type="text" value={this.course.name} onChange={e => (this.course.name = e.target.value)} />
          </li>
          <li>
            Students:
            <ul>
              {this.students.map(student => (
                <li key={student.id}>
                  {student.name}{' '}
                  <button type="button" onClick={() => this.removeStudent(student.id)}>
                    -
                  </button>
                </li>
              ))}
            </ul>
            Add course:
            <ul>
              {this.allStudents
                .filter(allStudent => this.students.every(student => allStudent.id != student.id))
                .map(student => (
                  <li key={student.id}>
                    {student.name}{' '}
                    <button type="button" onClick={() => this.addStudent(student.id)}>
                      +
                    </button>
                  </li>
                ))}
            </ul>
          </li>
        </ul>
        <button type="save" onClick={this.save}>
          Save
        </button>
      </div>
    );
  }

  mounted() {
    courseService.getCourse(this.props.match.params.id, course => {
      this.course = course;
    });

    courseService.getStudents(this.props.match.params.id, students => {
      this.students = students;
    });

    studentService.getStudents(students => {
      this.allStudents = students;
    });
  }

  removeStudent(id) {
    courseService.removeStudent(this.props.match.params.id, id, () => {
      courseService.getStudents(this.props.match.params.id, students => {
        this.students = students;
      });
    });
  }

  addStudent(id) {
    courseService.addStudent(this.props.match.params.id, id, () => {
      courseService.getStudents(this.props.match.params.id, students => {
        this.students = students;
      });
    });
  }

  save() {
    courseService.updateCourse(this.course, () => {
      history.push('/courses/' + this.props.match.params.id);
    });
  }
}

ReactDOM.render(
  <HashRouter>
    <div>
      <Menu />
      <Route exact path="/" component={Home} />
      <Route exact path="/students" component={StudentList} />
      <Route exact path="/courses" component={CourseList} />
      <Route exact path="/new_student" component={StudentNew} />
      <Route exact path="/new_course" component={CourseNew} />
      <Route exact path="/students/:id" component={StudentDetails} />
      <Route exact path="/students/:id/edit" component={StudentEdit} />
      <Route exact path="/courses/:id" component={CourseDetails} />
      <Route exact path="/courses/:id/edit" component={CourseEdit} />
    </div>
  </HashRouter>,
  document.getElementById('root')
);

