import { connection } from './mysql_connection';

class StudentService {
  getStudents(success) {
    connection.query('select * from Students', (error, results) => {
      if (error) return console.error(error);

      success(results);
    });
  }

  getStudent(id, success) {
    connection.query('select * from Students where id=?', [id], (error, results) => {
      if (error) return console.error(error);

      success(results[0]);
    });
  }

  getCourses(id, success) {
    connection.query(
      'select * from Courses INNER JOIN CourseStudents on Courses.id=CourseStudents.courseId where CourseStudents.studentId=?',
      [id],
      (error, results) => {
        if (error) return console.error(error);

        success(results);
      }
    );
  }

  addCourse(studentId, courseId, success) {
    connection.query(
      'insert into CourseStudents (studentId, courseId) values (?, ?)',
      [studentId, courseId],
      (error, results) => {
        if (error) return console.error(error);

        success();
      }
    );
  }

  removeCourse(studentId, courseId, success) {
    connection.query(
      'delete from CourseStudents where studentId=? and courseId=?',
      [studentId, courseId],
      (error, results) => {
        if (error) return console.error(error);

        success();
      }
    );
  }

  addStudent(name, email, success) {
    connection.query('insert into Students (name, email) values (?, ?)', [name, email], (error, results) => {
      if (error) return console.error(error);

      success(results.insertId);
    });
  }

  updateStudent(student, success) {
    connection.query(
      'update Students set name=?, email=? where id=?',
      [student.name, student.email, student.id],
      (error, results) => {
        if (error) return console.error(error);

        success();
      }
    );
  }

  deleteStudent(id, success) {
    connection.query('delete from CourseStudents where studentId = ?', [id], (error, results) => {
      connection.query('delete from Students where id = ?', [id], (error, results) => {
        if (error) return console.error(error);

        success();
      });
    });
  }
}
export let studentService = new StudentService();

class CourseService {
  getCourses(success) {
    connection.query('select * from Courses', (error, results) => {
      if (error) return console.error(error);

      success(results);
    });
  }

  getCourse(id, success) {
    connection.query('select * from Courses where id=?', [id], (error, results) => {
      if (error) return console.error(error);

      success(results[0]);
    });
  }

  getStudents(id, success) {
    connection.query(
      'select * from Students INNER JOIN CourseStudents on Students.id=CourseStudents.studentId where CourseStudents.courseId=?',
      [id],
      (error, results) => {
        if (error) return console.error(error);

        success(results);
      }
    );
  }

  addStudent(courseId, studentId, success) {
    connection.query(
      'insert into CourseStudents (courseId, studentId) values (?, ?)',
      [courseId, studentId],
      (error, results) => {
        if (error) return console.error(error);

        success();
      }
    );
  }

  removeStudent(courseId, studentId, success) {
    connection.query(
      'delete from CourseStudents where courseId=? and studentId=?',
      [courseId, studentId],
      (error, results) => {
        if (error) return console.error(error);

        success();
      }
    );
  }

  addCourse(code, name, success) {
    connection.query('insert into Courses (code, name) values (?, ?)', [code, name], (error, results) => {
      if (error) return console.error(error);

      success(results.insertId);
    });
  }

  updateCourse(course, success) {
    connection.query(
      'update Courses set code=?, name=? where id=?',
      [course.code, course.name, course.id],
      (error, results) => {
        if (error) return console.error(error);

        success();
      }
    );
  }

  deleteCourse(id, success) {
    connection.query('delete from CourseStudents where courseId = ?', [id], (error, results) => {
      connection.query('delete from Courses where id = ?', [id], (error, results) => {
        if (error) return console.error(error);

        success();
      });
    });
  }
}
export let courseService = new CourseService();

